import React from 'react';
import FadeIn from 'react-fade-in';
import "../styles/research.css"

const preparation = [
  {
    title: "Preconditioned Visual Language Inference with Weak Supervision.",
    authors: <span>Ehsan Qasemi, <b>Amani Maina-Kilaas</b>, Devadutta Dash, Khalid Alsaggaf, and Muhao Chen</span>,
  },
  {
    title: "The Algorithmic Search Framework.",
    authors: <span>Hina Ahmed, <b>Amani Maina-Kilaas</b>, Shifa Somji, Isabel Duan, Cynthia Hom, George Monta&ntilde;ez</span>
  },
];

const publications = [
  {
    year: 2023,
    title: "An Interpretable Joint Nonnegative Matrix Factorization-Based Point Cloud Distance Measure.",
    authors: <span>Hannah Friedman, <b>Amani Maina-Kilaas</b>, Julianna Schalkwyk, Hina Ahmed and Jamie Haddock</span>,
    location: "57th Annual Conference on Information Sciences and Systems",
    pdf: "jnmf-distance-measure.pdf",
    doi: "https://www.doi.org/10.1109/CISS56502.2023.10089765",
    code: "https://github.com/hannahfriedman/Joint_NMF_Similarity_Measure_and_Method",
  },
  {
    year: 2021,
    title: "The Hero's Dilemma: Survival Advantages of Intention Perception in Virtual Agent Games.",
    authors: <span><b>Amani Maina-Kilaas</b>, George Monta&ntilde;ez, Cynthia Hom, Kevin Ginta, and Cindy Lay</span>,
    location: "2021 IEEE Conference on Games",
    pdf: "the-heros-dilemma.pdf",
    doi: "https://www.doi.org/10.1109/CoG52621.2021.9619071",
    code: "https://github.com/AMISTAD-lab/heros-dilemma-source",
  },
  {
    year: 2021,
    title: "The Predator's Purpose: Intention Perception in Simulated Agent Environments.",
    authors: <span><b>Amani Maina-Kilaas</b>, Cynthia Hom, Kevin Ginta, and George Monta&ntilde;ez</span>,
    location: "2021 IEEE Congress on Evolutionary Computation",
    pdf: "the-predators-purpose.pdf",
    doi: "https://www.doi.org/10.1109/CEC45853.2021.9504885",
    code: "https://github.com/AMISTAD-lab/predators-purpose-source",
  },
  {
    year: 2021,
    title: "The Gopher's Gambit: Survival Advantages of Artifact-Based Intention Perception.",
    authors: <span>Cynthia Hom, <b>Amani Maina-Kilaas</b>, Kevin Ginta, Cindy Lay, and George Monta&ntilde;ez</span>,
    location: "13th International Conference on Agents and Artificial Intelligence",
    pdf: "the-gophers-gambit.pdf",
    doi: "https://www.doi.org/10.5220/0010207502050215",
    code: "https://github.com/AMISTAD-lab/gophers-gambit-source",
  },
];

const Publication = ({year, title, authors, location, pdf, doi, code}) => {
  return (
    <div class="publication">
      <div>
        <p class="year">{year}</p>
      </div>
      <div>
        <p class="title">{title}</p>
        <p class="authors">{authors}</p>
        <p class="location">{location}</p>
        <span class="links">
          {pdf ? <a href={process.env.PUBLIC_URL + '/' + pdf}>PDF&emsp;</a> : ""}
          {doi ? <a href={doi}>DOI&emsp;</a> : ""}
          {code ? <a href={code}>CODE&emsp;</a> : ""}
        </span>
      </div>
    </div>
  );
}

const makePub = (pub) => 
<Publication
   year={pub.year}
   title={pub.title}
   authors={pub.authors}
   location={pub.location} 
   pdf={pub.pdf}
   doi={pub.doi}
   code={pub.code}
/>;

const Research = () => {
  return (
    <div id="research-div">
      <FadeIn><h1>Research</h1></FadeIn>
      <FadeIn><h2>Publications</h2></FadeIn>
      {publications.map(makePub)}
      <FadeIn><h2>In Preparation</h2></FadeIn>
      {preparation.map(makePub)}
    </div>
  );
}

export default Research;
